import Assignment2 from "./components/Assignment2/assignment";
import Assignment3 from "./components/Assignment3/assignment";
import Assignment4 from "./components/Assignment4/assignment";


function App() {

  let Router = createBrowserRouter([
    {

      path:'/TrainingAssignments',
      element:<RootLayout />,
      children:[
        {
          path:'Assignment1',
          element:<h1>Hwleiwofh</h1>
        },
        {
          path:'Assignment2',
          element:<Assignment2 />,
        },
        {
          path:'Assignment3',
          element:<Assignment3 />
        },
        {
          path:'Assignment4',
          element:<Assignment4 />
        }
      ]
    }
  ])

  return (
      <RouterProvider router={Router}/>
  );

}

export default App;
